Actionscript.script:
function 自爆攻击(shootX, shootY){
	var 声音 = "";
	var 霰弹值 = 1;
	var 子弹散射度 = 0;
	var 发射效果 = "";
	var 子弹种类 = "普通爆炸";
	var 子弹威力 = _parent.空手攻击力 * 10;
	var 子弹速度 = 0;
	var 击中地图效果 = "";
	var Z轴攻击范围 = 100;
	var 击倒率 = 1;
	var 击中后子弹的效果 = "";
	var 子弹敌我属性 = !_parent.是否为敌人;
	_root.子弹区域shoot(声音,霰弹值,子弹散射度,发射效果,子弹种类,子弹威力,子弹速度, Z轴攻击范围,击中地图效果, _parent._name, shootX, shootY, _parent.Z轴坐标,子弹敌我属性,击倒率,击中后子弹的效果);
}

if(_parent.hp <= 0)
{
   if(_parent.已加经验值 != true)
   {
      if(_parent.是否为敌人 == true)
      {
         _root.敌人死亡计数 = _root.敌人死亡计数 + 1;
         _root.gameworld[_parent.产生源].僵尸型敌人场上实际人数--;
         _root.gameworld[_parent.产生源].僵尸型敌人总个数--;
         _parent.计算经验值();
      }
      _parent.人物文字信息._visible = 0;
      _root.add2map(_parent,2);
      _parent.removeMovieClip();
   }
}
stop();
